import React, {useState, useEffect} from 'react'

function Questions() {

    const [question, setQuestion] = useState([]);

    useEffect(()=>{
        fetch("http://localhost/bachelor_exam/questions.php")
        .then(response => response.json())
        .then((result)=>{
            console.log(result);
        } )
    }, [])
    
  return (
    <div>Questions</div>
  )
}

export default Questions
